/////////////////////////////////
// Test results
/////////////////////////////////
var TestResult = (function () {
    function TestResult() {
        this.stdout = '';
        this.stderr = '';
        this.exitCode = 0;
        this.attempts = 1;
    }
    Object.defineProperty(TestResult.prototype, "success", {
        get: function () {
            return this.exitCode === 0;
        },
        enumerable: true,
        configurable: true
    });
    return TestResult;
})();
module.exports = TestResult;
